import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import { Container, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Cards() {
  return (
    <>
        <nav class="Navbar">
          <div class="cards_container">
          <h1>Our Services</h1>
          <h4>Choose from our wide range of household services</h4>
          <body>
<button class="tablink" onclick="openPage('News', this, 'green')" id="defaultOpen"><b>All</b><br/>Services</button>
<button class="tablink" onclick="openPage('Contact', this, 'blue')"><b>Clean</b><br/>My Home</button>
<button class="tablink" onclick="openPage('About', this, 'orange')">Guard<br/><b>My Home</b></button>

<div id="News" class="tabcontent">
  <h3>News</h3>
  <p>Some news this fine day!</p>
</div>

<div id="Contact" class="tabcontent">
  <h3>Contact</h3>
  <p>Get in touch, or swing by for a cup of coffee.</p>
</div>

<div id="About" class="tabcontent">
  <h3>About</h3>
  <p>Who we are and what we do.</p>
</div>
</body>

          </div>
        </nav>

    </>
  );
}

export default Cards;
